g.title:
LHet begrip officiële taal is meerduidig. Hoewel zeer veel gebruikt, heeft het noch in België, noch in Nederland een juridische status. Er kunnen ten minste drie invullingen aan worden gegeven: 
* als juridisch begrip; 
* als omgangstalig substituut voor een taal met een wettelijke functie in het openbaar bestuur; 
* als taal waarvan het bestaan of de waarde door de overheid wordt erkend.

